import React from 'react';
import './App.css';
import Charts from './containers/Surfboards'

const charts = [{
date: 1984,
country: "UK",
songs: [{name:"do be do", artist: "kylie"},{name:"song 2", artist: "danni"}, ]
}]



function App() {
  return (
    <div className="App">
    App Container
    <Charts charts={charts} />
    </div>
  );
}

export default App;
